import {useState} from 'react'
import Employee from './Employee';
function App () {
const [count,setCount] =useState(0)

    
    const addCount=()=> {
setCount(count+1)

    }   
    let emp =[{name: 'ashi' ,age: 1},
    {name: 'akhil' ,age:30},
    {name: 'Thamburu' ,age: 28},
  ]                                                  
  return(
    <div className='App'>
       
    <button onClick={addCount} >Add</button>
    {
      emp.map((obj)=>{
        return (
          <Employee name={obj.name} age={obj.age} />
        )
      })
    }
   
     </div>
  );
}
export default App;
